/** @format */

import React from 'react';
import { useSelector } from 'react-redux';
import { CircularProgressbar } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import { Link } from 'react-router-dom';

function Profile(props) {
	const userSignin = useSelector((state) => state.userSignin);
	const { userInfo } = userSignin;

	const percentage = 60;

	return (
		<>
			<div className="container mt-5 mb-5 ">
				<div className="row container-border">
					<div className="col-md-2"></div>
					<div className="col-md-8">
						<div className="row">
							<div className="col-md-6 center">
								<img
									src="https://miro.medium.com/max/1187/1*0FqDC0_r1f5xFz3IywLYRA.jpeg"
									alt="profile-img"
									className="user-img"
								/>
							</div>
							<div className="col-md-6 mt-4">
								<div className="">
									<p className="">
										<i className="fa fa-user icon"></i> <b>Name:</b> {userInfo.firstName}
										{userInfo.lastName}
									</p>
									<p className="">
										<i className="fa fa-phone fa-flip-horizontal icon"></i>
										<b>Phone ID: </b>0{userInfo.phone}
									</p>
									<p className="">
										<i className="fa fa-users icon"></i> <b>Cluster:</b> FarmersCoop,
										Ibadan
									</p>
								</div>
							</div>
						</div>
						<div className="row packages-row">
							<div className="col-md-6 border-right">
								<h5>FarmSured Packages</h5>
								<Link className="">
									<i className="fa fa-check icon"></i> BroilerSure
									<CircularProgressbar
										value={percentage}
										text={`${percentage}%`}
										className="circular-bar ml-2"
										styles={{
											text: {
												fill: '#f88',
												fontSize: '30px'
											}
										}}
									/>
									;
								</Link>
								<Link className="">
									<i className="fa fa-check icon"></i> BroilerSure
									<CircularProgressbar
										value={percentage}
										text={`${percentage}%`}
										className="circular-bar ml-2"
										styles={{
											text: {
												fill: '#f88',
												fontSize: '30px'
											}
										}}
									/>
									;
								</Link>
								<Link to="/" className="btn btn-primary btn-sm mt-3 mb-5">
									ADD NEW FARM
								</Link>
							</div>
							<div className="col-md-6">
								<h5 className="">FarmSured Rewards</h5>
								<span className="point-text">Total Points</span>
								<span className="point-color">104</span> <br />
								<div className="mt-3 insu-info">
									<h4 className="">
										<i className="fa fa-circle"></i> FarmHealth Basic
									</h4>
									<p className="ml-3 mt-2">
										<i className="fa fa-check"></i> Free Farm Insurance
									</p>
									<div className="ml-5">
										<p className=""> - Broiler Farm Protected</p>
										<p className=""> - Broiler Farm Protected</p>
									</div>
									<p className="ml-3 mt-1">
										<i className="fa fa-check"></i> Free Health Insurance
									</p>
									<div className="ml-5">
										<p className=""> - 4 persons access to basic medicial insurance</p>
									</div>
								</div>
								<button className="btn btn-primary btn-sm mt-5">CLAIM REWARD</button>
							</div>
						</div>
					</div>
					<div className="col-md-2"></div>
				</div>
			</div>
		</>
	);
}

export default Profile;
